import React from 'react';
import './App.css';
import HomePage from './pages/HomePage/HomePage';
import { Switch, Route } from 'react-router-dom';

const HatsPage = () => (
  <div>
    <h1>HatsPage</h1>
  </div>
);

function App() {
  return (
    <div className="App">
      <Switch >
        <Route  exact path="/" component={ HomePage }/>
        <Route  exact path="/HatsPage" component={ HatsPage }/>
      </Switch>
    </div>
  );
}

export default App;
